def GetData(name):
    return image_catalog[name].GetData()

def ScaleImage(name, width, height):
    image = image_catalog[name].GetImage()
    image = image.Scale(width, height, wx.IMAGE_QUALITY_HIGH)
    return image

def GetImage(name, width=-1, height=-1):
    if (width,height) == (-1,-1):
        return image_catalog[name].GetImage()
    else:
        image = ScaleImage(name, width, height)
    image = wx.Image(image)
    return image

def GetBitmap(name, width=-1, height=-1):
    if (width,height) == (-1,-1):
        return image_catalog[name].GetBitmap()
    else:
        image = ScaleImage(name, width, height)
    image = wx.Bitmap(image)
    return image

def GetIcon(name, width=-1, height=-1):
    if (width,height) == (-1,-1):
        return image_catalog[name].GetIcon()
    else:
        image = ScaleImage(name, width, height)
    image = wx.Icon(image)
    return image

